import React from 'react'
import AboutUs from '../components/AboutUs'

const AboutPage = () => {
  const documentHeading = document.getElementById('documentHeading')
  documentHeading.innerHTML = 'Scapes & Surveys | About Us'

  return (
    <div>
      
        <AboutUs />
    </div>
  )
}

export default AboutPage
